import React from "react";
import heroImage from "../assets/hero.jpg"; // Apna hero image yaha rakho

const Home = () => {
  return (
    <div className="hero">
      <img src={heroImage} alt="Hero" className="hero-img" />
      <div className="hero-text">
        <h2>Elegant Jewelry</h2>
        <p>Explore our stunning handcrafted collections</p>
      </div>
    </div>
  );
};

export default Home;
